import React from 'react';
import Grid from '@material-ui/core/Grid';
const Home=()=>{
    return(
        <>
      <Grid container style={{position: 'absolute', top:'0',zIndex:0}}>
            <Grid item xs={12} style={{height:"505px",backgroundImage:`url("https://attorco.themestek.com/demo1/wp-content/uploads/sites/4/2019/06/slider1-02.jpg")`,backgroundSize:"100%"}}>
            </Grid>
      </Grid>
        </>
);
}

export default Home;
